- Auction sniping ( standalone &amp; server-based / SE )

- Auction tracking, feedback &amp; email automation

- Bulk searching &amp; data extraction

- MS Excel &amp; MS Outlook interfaces

- Universal automation &amp; analysis ( Macros &amp; Scripts ! )

